var vkSoundsRes={
  On:'data:audio/wav;base64,',
  New:'data:audio/wav;base64,',
  Msg:'data:audio/wav;base64,',  
  On_mp3:'data:audio/mp3;base64,',  
  New_mp3:'data:audio/mp3;base64,',
  Msg_mp3:'data:audio/mp3;base64,'
}

if (!window.Sound2){
  Sound2 = function(sound){
    //alert(sound);
	var audioObj = vkCe('audio');
	if (vkbrowser.safari || vkbrowser.chrome) sound+='_mp3';
	var snd='';
	if (vkLocalStoreReady() && vkGetVal('sound_'+sound)) snd=vkGetVal('sound_'+sound);
	if (!snd || snd=='') snd=vkSoundsRes[sound];
	//var notification = new Audio(snd);
	if (!audioObj.canPlayType){
		alert('no');
		audioObj.load=function(){};
		audioObj.play=function(){};
		audioObj.pause=function(){};
	}
	audioObj.src=snd;
	audioObj.load();
   
   var vol=function(){
      if (audioObj.volume)
         audioObj.volume = parseFloat(((window.localStorage?localStorage['vk_sounds_vol']:100)|| 100) / 100); 
   }
   
	this.pause = function(){ 
      vol();
      audioObj.pause(); 
   };
   this.play  = function(){ 
      vol();
      audioObj.play() 
   };
	//function(){      notification.play();   };
  }
}

